import React, {Fragment, useState} from "react";
import { Link } from "react-router-dom";
import { toast } from "react-toastify";


const Register = ({setAuth}) => {

  const [inputs, setInputs] = useState({
    email: "",
    password: "",
    name: "",
    lastname: "",
    adress: "",
  })

  const {email, password, name, lastname, adress} = inputs;

  const onChange = (e) => {
    setInputs({...inputs, [e.target.name]
    : e.target.value });
  }

  const onSubmitForm = async (e) => {
    e.preventDefault()

    try{
      const body = {email, password, name}
      const response = await fetch("http://localhost:5000/auth/register", {
        method: "POST",
        headers: {"Content-Type" : "application/json"},
        body: JSON.stringify(body)
      });

      const parseRes = await response.json()

      if(parseRes.token) {
        localStorage.setItem("token", parseRes.token);
        setAuth(true);
        toast.success("Registered Successfully!")
      } else {
        setAuth(false);
        toast.error(parseRes);
      }

    } catch (err) {
      console.error(err.message)
    }
  }

  return (
    <Fragment>
      <section className="p-6 max-w-7xl mx-auto mt-20 dark:bg-gray-800 dark:text-gray-50">
	<form novalidate="" action="" className="container flex flex-col mx-auto space-y-12 ng-untouched ng-pristine ng-valid">
		<fieldset className="grid grid-cols-4 gap-6 p-6 rounded-md shadow-sm dark:bg-gray-900">
			<div className="space-y-2 col-span-full lg:col-span-1">
				<p className="font-medium">Personal Inormation</p>
				<p className="text-xs">Lorem ipsum dolor sit, amet consectetur adipisicing elit. Adipisci fuga autem eum!</p>
			</div>
			<div className="grid grid-cols-6 gap-4 col-span-full lg:col-span-3">
				<div className="col-span-full sm:col-span-3">
					<label for="name" className="text-sm">İsim</label>
					<input
                  id="name"
                  type="text"
                  name="name"
                  onChange={e => onChange(e)}
                  value={name}
                  className="w-full rounded-md focus:ring-orange-500 bg-zinc-200 p-2.5" />
                  </div>
				<div className="col-span-full sm:col-span-3">
					<label for="lastname" className="text-sm">Soyisim</label>
					<input
                  id="lastname"
                  type="text"
                  name="lastname"
                  onChange={e => onChange(e)}
                  value={lastname}
                  className="w-full rounded-md focus:ring-orange-500 bg-zinc-200 p-2.5" />
				</div>
				<div className="col-span-full sm:col-span-3">
					<label for="email" className="text-sm">Email</label>
					<input
                  id="email"
                  type="email"
                  name="email"
                  onChange={e => onChange(e)}
                  value={email}
                  className="w-full rounded-md focus:ring-orange-500 bg-zinc-200 p-2.5" />
				</div>
				<div className="col-span-full">
					<label for="address" className="text-sm">Address</label>
					<input
                  id="adress"
                  type="text"
                  name="adress"
                  onChange={e => onChange(e)}
                  value={adress}
                  className="w-full rounded-md focus:ring-orange-500 bg-zinc-200 p-2.5" />
				</div>
				<div className="col-span-full sm:col-span-2">
					<label for="city" className="text-sm">City</label>
					<input id="city" type="text" placeholder="" className="w-full rounded-md focus:ring focus:ring-opacity-75 focus:ring-violet-400 dark:border-gray-700 dark:text-gray-900" />
				</div>
				<div className="col-span-full sm:col-span-2">
					<label for="state" className="text-sm">State / Province</label>
					<input id="state" type="text" placeholder="" className="w-full rounded-md focus:ring focus:ring-opacity-75 focus:ring-violet-400 dark:border-gray-700 dark:text-gray-900" />
				</div>
				<div className="col-span-full sm:col-span-2">
					<label for="zip" className="text-sm">ZIP / Postal</label>
					<input id="zip" type="text" placeholder="" className="w-full rounded-md focus:ring focus:ring-opacity-75 focus:ring-violet-400 dark:border-gray-700 dark:text-gray-900" />
				</div>
			</div>
		</fieldset>
	</form>
</section>
